package data_structure;public class MSTEdgeNode {	int tail = -1;	int head = -1;	int key = 0;	public MSTEdgeNode(int t, int h, int k) {		tail = t;		head = h;		key = k;	}	public String toString() {		return "<" + head + "," + tail + "," + key + ">";	}	@Override	public boolean equals(Object arg0) {		if (arg0 != null && arg0 instanceof MSTEdgeNode) {			MSTEdgeNode edgeNode = (MSTEdgeNode) arg0;			return this.tail == edgeNode.tail && this.head == edgeNode.head					&& this.key == edgeNode.key;		}		return false;	}}